import { ColorTheme } from '../types';

export const DarkTheme: ColorTheme = {
  colors: {
    primary: 'rgb(255, 255, 255)',
    background: 'rgb(28, 28, 30)',
    card: 'rgb(28, 28, 30)',
    text: 'rgb(255, 255, 255)',
    border: 'rgb(28, 28, 30)',
    notification: 'rgb(255, 255, 255)',
    accent: 'rgb(78, 141, 228)',
    input: 'rgb(45, 45, 45)'
  }
}
